import React from "react";
import {GoogleMap, Marker, withGoogleMap, withScriptjs} from "react-google-maps";
import {useDispatch, useSelector} from "react-redux";
import {getRouteStations, getTimeBusByStationId} from "../redux/apiMobileV2/ApiMobileV2Action";


export default function Maps() {
    const dispatch = useDispatch();
    const data = useSelector(state => state.apiMobileV2Reducer.routeStationsData);
    React.useEffect(() => {
        dispatch(getRouteStations(550));
    }, []);
    console.log("mylog", data);
    const stations = data ? data.kpp1 : 0;

    const CustomSkinMap = withScriptjs(withGoogleMap(() => (
            <GoogleMap
                defaultZoom={13}
                defaultCenter={{lat: 41.320052, lng: 69.253966}}
                defaultOptions={{
                    scrollwheel: false,
                    zoomControl: true,
                }}
            >
                {stations ? stations.map((item, index) => {
                    <Marker key={index++} position={{lat: item.lat, lng: item.lng}}/>;
                }):''}
                <Marker position={{lat: 41.320052, lng: 69.253966}}/>
            </GoogleMap>
        ))
    );

    return (
        <CustomSkinMap
            googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyDS4sGjQ5hi3IFNYa0dYGyuxmNZzPwv1jc"
            loadingElement={<div style={{height: `100%`}}/>}
            containerElement={<div style={{height: `80vh`}}/>}
            mapElement={<div style={{height: `100%`}}/>}
        />
    );
};
